import React from 'react';

function Main() {
    return (
    <main>
      <section className='css'>
        <h2>CSS & Design</h2>
        <ul>
          <li>Color Theory</li>
          <li>Fonts</li>
          <li>UI/UX</li>
        </ul>
      </section>
    </main>
  )
}

export default Main;
